// viwer
import './Add.css';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';

// Return Add componnt 
export default function ReturnAdd() {
 return (
  <div className='wrp-admin'>

   <nav className='nav-admin'>
    <div className='next-arrow'>next</div>
    <ul>
     <li>Acceuil</li>
     <li>Membres</li>
    </ul>
   </nav>


   <div className='wrp-left-add-members'>

    <h2>Card Form</h2>
    <h2>Ajouter ou editer un membre</h2>


    <div className='wrp-form'>
     <Form>
      <div class="mb-3">
       <label for="exampleFormControlInput1" class="form-label">Email Agent</label>
       <input type="email" class="form-control" id="exampleFormControlInput1" placeholder="name@e-mail.com" />
      </div>

      <Link to={'/admin'}>
       <Button variant="primary" type="submit">
        Connexion
    </Button>
      </Link>

     </Form>
    </div>



   </div>
  </div>
 )
};
